window.onload=function(){$("#branch_change").on("click",function(){var n=$("#branch_list").val();console.log(n),$.ajax({type:"POST",url:"deploy/change_deploy.php",dataType:"JSON",data:{branch:n}}).done(function(n){$("#branch_result").text(n.data)}).fail(function(){$("#branch_result").text("失敗しました")})})};